    getCardSymbolImg(cardName) {
      if (cardName == "1") {
        return "";
      }

      let char = "";
      let type = "";
      let className = "";
      let value = ""; // let value = {};

      if (cardName.length == 4) {
        char = cardName.substring(0, 2);
        type = cardName.slice(2);
      } else {
        char = cardName.charAt(0);
        type = cardName.slice(1);
      }

      switch (type) {
        case "HH":
          type = "}";
          className = "card-black1";
          break;

        case "DD":
          type = "{";
          className = "card-red1";
          break;

        case "CC":
          type = "]";
          className = "card-black1";
          break;

        case "SS":
          type = "[";
          className = "card-red1";
          break;
      }

      value = char + '<span class="' + className + '">' + type + "</span>";
      return value; // return value = { type, className, char };
    }

